import "./App.css";
import Todo from "./components/Todo";

function App() {
  return (
    <div class="container">
      <div class="page-header">
        <h1>Đây là ứng dụng ReactJs</h1>
      </div>
      <div>
        <ul class="breadcrumb">
          <li>
            <a
              href="#"
              onClick={() => {
                this.handleOnlickHome();
              }}
            >
              Home
            </a>
          </li>
          <li>
            <a href="#">Todo</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default App;
